span class="vcard author"><span class="fn"><a href="http://portalsasiedzi.pl/?author=6" title="Wpisy, ktorych autorem jest Kasia Krzyszkowska" rel="author">Kasia Krzyszkowska</a></span></span></span></span></span></header><div class="entry-content"  itemprop="text" ><p>W niedziele 11 listopada 2018 roku bedziemy obchodzic uroczyscie 100-lecie odzyskania przez Polske niepodleglosci. Zapraszamy wszystkich mieszkancow do wlaczenia sie w piaseczynskie obchody, ktore zostana podzielone na dwie czesci. O godz. 10.00 w kosciele sw. Anny w Piasecznie zostanie odprawiona msza swieta w intencji Ojczyzny, po ktorej nastapia przemowienia okolicznosciowe i zlozenie wiazanek pod tablica marszalka Jozefa [&hellip;]</p>
