<div class='flex_column av_one_third  first el_before_av_one_third'><section id="text-2" class="widget clearfix widget_text"><h3 class="widgettitle">O nas</h3>			<div class="textwidget"><p>Portal Sasiedzi powstal jako naturalna konsekwencja naszych dzialan na rzecz budowania spoleczenstwa obywatelskiego i tozsamosci zwiazanej z miejscem w ktorym zyjemy.  Wszyscy skads przybylismy, ale nasze dzieci sa juz rdzennymi mieszkancami suburbiow Warszawy. Postanowilismy wiec zrobic wszystko, co w naszej mocy, zeby najpierw Jozefoslaw i Julianow, a potem kolejne miejscowosci na poludnie od Warszawy staly sie dla ich mieszkancow prawdziwa, mala Ojczyzna. Dlatego powstal Magazyn ,,Sasiedzi", z tego powodu uruchomilismy Portal Sasiedzi i zaczynamy prace nad Telewizja Sasiedzi. Chcemy dac Wam, mieszkancom poludniowej czesci aglomeracji warszawskiej platforme i medium do dostepu do informacji, wymiany idei, pomyslow, poznawanie siebie wzajemnie, krzewienia spolecznikowskich pasji i kulturalnych zainteresowan. Zapraszamy!</p>
<p>Kontakt:<br />
tel.:  532 058 059<br />
email: redakcja@sasiedzi.eu</p>
